import { Component, Output, EventEmitter, Input } from '@angular/core';

@Component({
    selector: 'app-weekly-calendar',
    templateUrl: './weekly-calendar.component.html',
    styleUrls: ['./weekly-calendar.component.css'],
})
export class WeeklyCalendarComponent {
    // filteredExercises: any[] = [];
    filteredMondayExercises: any[] = []; // Declare a variable to hold filtered exercises for Monday

    @Input() exercises: any[] = []; // Ensure 'exercises' is of the appropriate type

    @Output() squareClicked: EventEmitter<any> = new EventEmitter();

    // constructor() {
    //     // Initialize filteredMondayExercises with Monday's exercises on component initialization
    //     this.filteredMondayExercises = this.filterExercisesByDay("Monday");
    // }

    ngOnInit(): void {
        // Initialize filteredMondayExercises after 'exercises' is loaded
        if (this.exercises && this.exercises.length > 0) {
            this.filteredMondayExercises = this.filterExercisesByDay('Monday');
        }
    }

    openPopupOnClick() {
        this.squareClicked.emit();
    }

    filterExercisesByDay(day: string): any[] {
        console.log('Filtering for day:', day);
        console.log('ToDo::', this.exercises);
        const filteredExercises = this.exercises.filter((exercise: any) => exercise.day == day);
        console.log('Filtered exercises:', filteredExercises);
        return filteredExercises;
    }

}
<div class="calendar-background">
    <div class="calendar-container">
        <h3>GYM PLANNING</h3>
        <div id="calendar">
            <div class="placeholder"></div>
            <div class="calendar-events">
                <div class="day-title">
                    <div class="day">Monday</div>
                    <div class="day">Tuesday</div>
                    <div class="day">Wednesday</div>
                    <div class="day">Thursday</div>
                    <div class="day">Friday</div>
                    <div class="day">Saturday</div>
                    <div class="day">Sunday</div>
                </div>

                <div class="day-content">
                    <div class="square" (click)="openPopupOnClick()">

                        <!-- Content for Monday -->
                        <div *ngFor="let exercise of filteredMondayExercises" class="exercise">
                            <div *ngIf="exercise.day == 'Monday'">
                                <div class="exercise-details">
                                    <div class="name">{{ exercise.name }}</div>
                                    <div class="repetitions">Reps: {{ exercise.repetitions }}</div>
                                    <div class="weight">Weight: {{ exercise.weight }}</div>
                                    <div class="day">Day: {{ exercise.day }}</div>
                                    <!-- Add other exercise details as needed -->
                                </div>
                            </div>
                        </div>

                    </div>
                    <div class="square" (click)="openPopupOnClick()">
                        <div *ngFor="let exercise of exercises" class="exercise">
                            <div *ngIf="exercise.day == 'Tuesday'">
                                <div class="exercise-details">
                                    <div class="name">{{ exercise.name }}</div>
                                    <div class="repetitions">Reps: {{ exercise.repetitions }}</div>
                                    <div class="weight">Weight: {{ exercise.weight }}</div>
                                    <div class="day">Day: {{ exercise.day }}</div>
                                    <!-- Add other exercise details as needed -->
                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="square" (click)="openPopupOnClick()">

                    </div>
                    <div class="square" (click)="openPopupOnClick()">

                    </div>
                    <div class="square" (click)="openPopupOnClick()">

                    </div>
                    <div class="square" (click)="openPopupOnClick()">

                    </div>
                    <div class="square" (click)="openPopupOnClick()">

                    </div>

                </div>

            </div>
        </div>
    </div>
</div>
